import './App.css';
import NavBar from './components/NavBar/navbar';
import UpperBody from './components/UpperBody/upperbody';
import LowerBody from './components/LowerBody/lowerbody';
import { Router, Switch , Route } from 'react-router';

function App() {
  return (
    <div className="App">

    <Router>
      <NavBar />
      <Switch>

      <Route exact path = '/'>
        <Home />
      </Route>
       <UpperBody />
      {/* <Search /> */}
      <LowerBody />
      {/* <ServiceCards /> */}
      </Switch>
      </Router>
    </div>
  );
}

export default App;
